import { BrowserRouter as Routers,Router,Route,Link } from "react-router-dom"
import OTP1 from "./OTP1"
import OTP3 from "./OTP3"
function OTPROUTRS(){
    return(
        <div>
            <Router>
                <Routers>
                    <Route path="otp1" element={OTP1}/>
                    <Route path="otp2" element={OTP3}/>
                </Routers>
            </Router>


        </div>
    )
}
export default OTPROUTRS;
